import NavbarComp from "./NavbarComp";
import { Title } from "react-bulma-companion";

const MainPage = () => {
  return (
    <div>
      <NavbarComp />
      <Title style={{ fontFamily: "Alkalami, serif" }}>Main Page</Title>
    </div>
  );
};

export default MainPage;
